import {REGISTER} from '../actions/types'
import combineReducer from 'redux';


const RegisterReducer = (data=[],action)=>{
    switch(action.type){
        case REGISTER:
            return [...data,action.paylod]
            default:
                return data
    }
}
export default combineReducer({
    RegisterReducer
})
